- input: "TEXT\x1CC00085506\x1C.TEXT\x1C\x1CF3XA\x1CRefunds were made in May 2008
    for contributions from the following in April 2008:  Mary Ceccarelli $65 and Bob
    Kessler $235.  Contributions were payments for State Republican Party Convention
    attendance and events.  Ms. Ceccarelli could not attend the dinner and was reimbursed
    for the cost of the dinner.  Mr. Kessler was unable to attend the convention,
    including all events and was reimbursed the total cost.                                                                                                                              Refund
    was also made to Lester Muraoka for $200.  Mr. Muraoka was unable to  attend the
    State Republican Party Convention, including all events and was reimbursed the
    total cost.                      "
